CREATE TABLE [Curso] ( 
CODCURS INT, 
NOMECURS VARCHAR(45), 
ESTRUTURACURS VARCHAR(45), 
MODALIDADECURS VARCHAR(45), 
CAMPUSCURS VARCHAR(3), 
PMINCURS INT, 
PMAXCURS INT, 
PRIMARY KEY (CODCURS) 
);

CREATE TABLE [Aluno] ( 
CPFALUNO INT, 
NOMEALUNO VARCHAR(45), 
PRIMARY KEY (CPFALUNO) 
);

CREATE TABLE [Seguradora] ( 
CNPJSEGURADORA INT, 
NOMESEGURADORA VARCHAR(45), 
PRIMARY KEY (CNPJSEGURADORA) 
);INSERT INTO SEGURADORA (CNPJSEGURADORA, NOMESEGURADORA) VALUES (1, 'Allianz Seguros S.A');

CREATE TABLE [Orientador] ( 
ORIENUMMATRICULA INT, 
ORIENOME VARCHAR(45), 
PRIMARY KEY (ORIENUMMATRICULA) 
);

CREATE TABLE [Supervisor] ( 
CPFSUPERVISOR INT, 
NOMESUPERVISOR VARCHAR(45), 
EMAILSUPERVISOR VARCHAR(45), 
PRIMARY KEY (CPFSUPERVISOR) 
);

CREATE TABLE [Concedente] ( 
CNPJCONCEDENTE INT, 
NOMECONCEDENTE  VARCHAR(45), 
ENDCONCEDENTE VARCHAR(45), 
BAIRROCONCEDENTE VARCHAR(45), 
CIDADECONCEDENTE VARCHAR(45), 
PRIMARY KEY (CNPJCONCEDENTE) 
);

CREATE TABLE [Inscrito] ( 
INSCMATRICULA int, 
CODCURS INT, 
CPFALUNO  int,
INSCSITUACAO VARCHAR(45), 
INSCPERIODO int, 
INSCPERCENTUALPC FLOAT, 
INSCPERCENTUALDO FLOAT,  
INSCDATAEXPEDICAO DATETIME, 
FOREIGN KEY (CODCURS) REFERENCES Curso(CODCURS), 
FOREIGN KEY (CPFALUNO) REFERENCES Aluno(CPFALUNO), 
PRIMARY KEY (INSCMATRICULA)
);

CREATE TABLE [Contrato] ( 
CONTID  INT, 
INSCMATRICULA INT, 
CONTESTOB VARCHAR(3), 
CONTDATAINICIO DATETIME, 
CONTDATAFIM DATETIME, 
FOREIGN KEY (INSCMATRICULA) REFERENCES Inscrito(INSCMATRICULA),
PRIMARY KEY (CONTID) 
);

CREATE TABLE [Seguro] (  
SEGAPOLICE  INT, 
SEGACNPJ INT, 
SEGSTATUS VARCHAR(20), 
FOREIGN KEY (SEGACNPJ) REFERENCES Seguradora(SEGACNPJ),
Primary KEY (SEGAPOLICE) 
);

CREATE TABLE [Estagio] ( 
CONTID INT, 
CNPJCONCEDENTE  INT, 
CPFSUPERVISOR  INT, 
ORIENUMMATRICULA  INT, 
SEGAPOLICE INT, 
FOREIGN KEY (CONTID) REFERENCES Contrato(CONTID),
FOREIGN KEY (CNPJCONCEDENTE) REFERENCES Concedente(CNPJCONCEDENTE),
FOREIGN KEY (CPFSUPERVISOR) REFERENCES Supervisor(CPFSUPERVISOR),
FOREIGN KEY (ORIENUMMATRICULA) REFERENCES Orientador(ORIENUMMATRICULA),
FOREIGN KEY (SEGAPOLICE) REFERENCES Seguro(SEGAPOLICE)
);

